		define("page/countScan.js", function(require, module, exports, window,document,frames,self,location,navigator,localStorage,history,Caches,screen,alert,confirm,prompt,XMLHttpRequest,WebSocket,Reporter,webkit,WeixinJSCore){ 			
"use strict";

var app = getApp();
var ApiReq = app.ApiReq;
var ApiUser = app.ApiUser;
var Tool = app.Tool;
//路径分类
var jumpUrl = {
    "tabUrl": {
        "personal": "/modules/mine/index",
        "travelIndex": "/modules/travel/index",
        "seatLogin": "/sub/seatModule/login",
        "fltSearch": "/sub/fltStatusModule/fltSearch"
    },
    "otherUrl": {
        "historyTravel": "/sub/travel/historyTravel",
        "mealsFlight": "/sub/meal/flightList",
        "delayCertificate": "/sub/delay/search",
        "eInvoice": "/sub/eInvoiceModule/eInvoice",
        "coupons": "/sub/luckCouponsModule/luckCoupons",
        "mileage": "/sub/luckMileageModule/luckMileage"
    }
};
// function getURL(str, params){
//     var ALL_URL = {
//         "countScan": "/api/scan/countScanTimesAndPerson", /*统计扫进来的渠道*/
//     };
//     return getApp().ApiInterface.getURL(ALL_URL[str], params)
// }
//外部引用的统计的方法
function coutScans(obj) {
    if (!obj) {
        app.navigator.switchTab({
            url: 'home'
        });
        return;
        //只做跳转
    } else if (obj.way == "skip") {
        jumpPage(obj);
        return;
    }
    //统计进来
    console.log(obj);
    ApiUser.getUserInfo({
        loading: true,
        needMember: false,
        success: function success(userInfo) {
            countChannel({
                data: {
                    openId: userInfo.user.openId,
                    activityId: obj.activityId
                },
                success: function success() {
                    jumpPage(obj);
                },
                fail: function fail() {
                    jumpPage(obj);
                }
            });
        },
        fail: function fail() {
            jumpPage(obj);
        }
    });
}
//统计扫进来的活动
function countChannel(obj) {
    if (!obj.data.activityId || !obj.data) {
        // wx.switchTab({
        //     url: "/modules/fltStatus/fltSearch"
        // })
        app.navigator.switchTab({
            url: 'home'
        });
        return;
    }
    ApiReq.post({
        loading: true,
        url: "COUNT_SCAN",
        data: obj.data,
        success: function success(res) {
            if (res.status != 3) {
                //若活动结束，弹框提示并跳转到默认首页
                Tool.alert({
                    content: "二维码已失效",
                    success: function success() {
                        app.navigator.switchTab({
                            url: 'home'
                        });
                    }
                });
            } else {
                if (obj.success && typeof obj.success == "function") {
                    obj.success();
                }
            }
        },
        fail: function fail() {
            if (obj.fail && typeof obj.fail == "function") {
                obj.fail();
            }
        }
    });
}
//扫进来跳转处理
function jumpPage(parms) {
    var str = urlencode(parms);
    console.log("str:" + str);
    if (parms.scanUrl == "tabUrl" && jumpUrl[parms.scanUrl][parms.urlName]) {
        if (parms.urlName == "seatLogin" || parms.urlName == "fltSearch") {
            app.navigator.redirect({
                url: jumpUrl[parms.scanUrl][parms.urlName]
            });
        } else {
            app.navigator.switchTab({
                url: jumpUrl[parms.scanUrl][parms.urlName]
            });
        }
    } else if (parms.scanUrl == "otherUrl" && jumpUrl[parms.scanUrl][parms.urlName]) {
        app.navigator.redirect({
            url: jumpUrl[parms.scanUrl][parms.urlName] + "?" + str
        });
    } else {
        app.navigator.switchTab({
            url: 'home'
        });
    }
}
//将对象转为url字符串
function urlencode(data) {
    var result = [];
    for (var key in data) {
        result.push(key + '=' + data[key]);
    }
    return result.join('&');
}
module.exports = {
    coutScans: coutScans
}; 
 			}); 
