/**
 * 验证身份证号方法（满足18位）
 * return  true或者false
 */
function checkIdentity(idCard) {
  // var reg = /(^\d{15}$)|(^\d{18}$)|(^\d{17}(\d|X|x)$)/;//一代身份不可用
  var reg = /(^\d{18}$)|(^\d{17}(\d|X|x)$)/;
  if (!reg.test(idCard)) return false;
  // 校验出生日期是否合法
  var birthday = idCard.substr(6, 4) + '-' + idCard.substr(10, 2) + '-' + idCard.substr(12, 2);
  if (!isDate(birthday)) return false;
  return true;
}
/**
 * 验证身份证号是否合法（符合公安部身份证号规则）
 * return  true或者false
 */
function checkIdentityLegal(idCard) {
  if (!checkIdentity(idCard)) return false;
  //∑(ai×Wi)(mod 11)
  //加权因子
  var factor = [7, 9, 10, 5, 8, 4, 2, 1, 6, 3, 7, 9, 10, 5, 8, 4, 2];
  //校验位
  var parity = [1, 0, 'X', 9, 8, 7, 6, 5, 4, 3, 2];
  var sum = 0,
      ai = 0,
      wi = 0;
  for (var i = 0; i < 17; i++) {
    ai = idCard[i];
    wi = factor[i];
    sum += ai * wi;
  }
  var last = parity[sum % 11];
  if (parity[sum % 11] != idCard[17].toLocaleUpperCase()) {
    return false;
  }
  return true;
}
