/**
 * 是否合法日期
 * @param date 日期 yyyy-mm-dd
 * @return true/false
 */
function isDate(date) {
  var a = date.split('-');
  var d = new Date(date.replace(/-/g, "/"));
  a[1] = Number(a[1]);
  a[2] = Number(a[2]);
  if (a[0] == d.getFullYear() && a[1] == d.getMonth() + 1 && a[2] == d.getDate()) return true;
  return false;
}
/**
 * 计算出生日期
 * @param birthday 出生日期 yyyy-mm-dd
 * @param toDate 当前日期（如果空取今天日期） yyyy-mm-dd
 * @return age 年龄 number
 */
function getAge(birthday, toDate) {
  if (!birthday) {
    return -1;
  }
  var age;
  var birthdayArr = birthday.split("-");
  var birthYear = birthdayArr[0];
  var birthMonth = birthdayArr[1];
  var birthDay = birthdayArr[2];
  if (toDate) {
    var todayArr = toDate.split("-");
    var nowYear = todayArr[0];
    var nowMonth = todayArr[1];
    var nowDay = todayArr[2];
  } else {
    var today = new Date();
    var nowYear = today.getFullYear();
    var nowMonth = today.getMonth() + 1;
    var nowDay = today.getDate();
  }

  if (nowYear == birthYear) {
    age = 0; //同年 则为0岁  
  } else {
    var ageDiff = nowYear - birthYear; //年之差  
    if (ageDiff > 0) {
      if (nowMonth == birthMonth) {
        var dayDiff = nowDay - birthDay; //日之差  
        if (dayDiff < 0) {
          age = ageDiff - 1;
        } else {
          age = ageDiff;
        }
      } else {
        var monthDiff = nowMonth - birthMonth; //月之差  
        if (monthDiff < 0) {
          age = ageDiff - 1;
        } else {
          age = ageDiff;
        }
      }
    } else {
      age = -1; //返回-1 表示出生日期输入错误 晚于今天  
    }
  }

  return age; //返回周岁年龄  
}
