function checkInterPhone(phone) {
  var phoneLen = phone.length;
  var n = 0;
  var arr = phone.split('');
  arr.map(function (val, index) {
    if (val === '-') {
      n++;
    }
  });
  var phoneNum = n == 1 ? phone.replace('-', '') : '-';
  var reg = /^[0-9]+$/;
  var isNum = reg.test(phoneNum);
  if (phoneLen >= 8 && phoneLen <= 25 && n === 1 && isNum) {
    return true;
  }
  return false;
}
//计算间隔天数 durationByDays('2018-07-21','2018-07-25')   => 4
function durationByDays(startTime, EndTime) {
  if (!startTime || !EndTime) {
    throw new Error('开始时间或者结束时间不能为空');
  }
  var durationTime = new Date(EndTime).getTime() - new Date(startTime).getTime();
  return durationTime / 24 / 60 / 60 / 1000;
}
