/**
 * 字符截取
 *
 * @param {String} str - 需要截取的字符串
 * @param {Number} length - 需要截取的字符长度(中文长度*2)
 * @returns {String} str - 截取的后字符串
 */
function cutStringLength(str, length) {
  if (!str) {
    return;
  }
  // 中文字符判断
  var reg = /[^\x00-\xff]/g;
  if (str.replace(reg, 'aa').length <= length) {
    return str;
  }
  var m = Math.floor(length / 2);
  var finalStr = str;
  for (var i = m; i < str.length; i++) {
    if (str.substr(0, i).replace(reg, 'aa').length >= length) {
      if (reg.test(str)) {
        finalStr = str.substr(0, i) + '...';
      } else {
        finalStr = str.substr(0, i - 1) + '...';
      }
      break;
    }
  }
  return finalStr;
}

function checkMember(member) {
  if (!member) {
    return false;
  }
  var reg = /^\d{12}$/;
  if (reg.test(member)) {
    var arr = member.split('');
    var sum = 0;
    for (var i = 1; i < arr.length; i++) {
      sum += Number(arr[i]);
    }
    return sum % 7 == arr[0];
  }
  return false;
}
// 版本比较
function compareVersion(targetVersion) {
  var version = wx.getSystemInfoSync().SDKVersion;
  var nowVersion = version.split('.');
  targetVersion = targetVersion.split('.');
  var len = Math.max(nowVersion.length, targetVersion.length);

  while (nowVersion.length < len) {
    nowVersion.push('0');
  }
  while (targetVersion.length < len) {
    targetVersion.push('0');
  }

  for (var i = 0; i < len; i++) {
    var num1 = parseInt(nowVersion[i]);
    var num2 = parseInt(targetVersion[i]);
    if (num1 > num2) {
      return 1;
    } else if (num1 < num2) {
      return -1;
    }
  }
  return 0;
}

function updateVersion() {
  if (typeof wx.getUpdateManager == "function") {
    var updateManager = wx.getUpdateManager();
    updateManager.onCheckForUpdate(function (res) {
      // 请求完新版本信息的回调
      console.log("请求完新版本信息-----------", res);
    });
    updateManager.onUpdateReady(function () {
      wx.showModal({
        title: '更新提示',
        content: '新版本已经准备好，是否重启应用？',
        success: function success(res) {
          if (res.confirm) {
            // 新的版本已经下载好，调用 applyUpdate 应用新版本并重启
            updateManager.applyUpdate();
          }
        }
      });
    });
    updateManager.onUpdateFailed(function (err) {
      // 新版本下载失败
      console.log('更新下载失败了', err);
    });
  }
}
