    /**
     * 返航、备降状态的详情数据特殊处理(数据可能有两条或三条以上出现)
     * 如果有两条数据以上就要考虑存在返航状态的详情，需过滤详情数据，展示返航最新航段信息，
     * 根据该字段soflSeqNr来从小到大排序（最新航段的soflSeqNr值总比返航备降大），
     * 返航航班详情的每个航段详情的 出发/到达机场的 三字码都是一样的，
     * @param detailsData
     * @returns {Array}
     */
    getRTNFlightDetails: function getRTNFlightDetails(flightDetails) {
        var details = [];
        var obj = {};
        flightDetails.sort(function (a, b) {
            return a.soflSeqNr - b.soflSeqNr;
        });
        flightDetails.forEach(function (item) {
            obj[item.schDepArp + '-' + item.schArvArp] = item;
        });
        for (var i in obj) {
            details.push(obj[i]);
        }
        return details;
    },


