    // 航延证明
    delayNav: function delayNav() {
        var number, date;
        var myDate = new Date();
        var y = myDate.getFullYear();
        var m = myDate.getMonth() + 1;
        var d = myDate.getDate();
        var mstr = m >= 10 ? m : "0" + m;
        var dStr = d >= 10 ? d : "0" + d;
        var date;
        //一维码的日期有三种格式：ddd,ddMM,dd
        if (scanData.fltDate.length == 2) {
            //格式为dd
            date = y + "-" + mstr + "-" + scanData.fltDate;
        } else if (scanData.fltDate.length == 4) {
            date = y + "-" + scanData.fltDate.substring(2, 4) + "-" + scanData.fltDate.substring(0, 2);
        } else if (scanData.fltDate.length == 3) {
            //天数转换为毫秒数，需将取到的天数减减1，否则日期算已过天数，会比实际的大一天
            var dateInt = parseFloat(scanData.fltDate);
            var days;
            if (y % 4 == 0) {
                //闰年需要特殊处理，因为js的日期是是1970年计算的,1970年的的2月只有28天
                if (dateInt <= 60) {
                    days = dateInt - 1;
                } else {
                    days = dateInt - 2;
                }
            } else {
                days = dateInt - 1;
            }
            days = days * 24 * 60 * 60 * 1000;
            var fltDateTemp = new Date(days);
            var mT = fltDateTemp.getMonth() + 1;
            var dT = fltDateTemp.getDate();
            var mstrT = mT >= 10 ? mT : "0" + mT;
            var dStrT = dT >= 10 ? dT : "0" + dT;
            if (y % 4 == 0 && dateInt == 60) {
                //2月月29号在这里处理
                mstrT = "02";
                dStrT = "29";
            }
            date = y + "-" + mstrT + "-" + dStrT;
        } else {
            date = scanData.fltDate;
        }
        APP.navigator.go({
            url: "delaySearch",
            data: { number: scanData.tktNo, date: date }
        });
        wx.reportAnalytics("board01_delay", {});
    },

