    getShowTime: function getShowTime(info) {
        var showDepDt = info.crewDepDt; //默认是预计时间
        var showArvDt = info.crewArvDt; //默认是预计时间
        var fltSts_code = info.flightStatus;
        if (fltSts_code == "AIR" || fltSts_code == "RTN") {
            //起飞，修改实际起飞时间
            showDepDt = info.actDepDt; //实际起飞时间
            showArvDt = info.schArvDt; //预计到达时间
        }

        if (fltSts_code == "CNL") {
            showDepDt = "--";
            showArvDt = "--";
        }

        if (fltSts_code == "ONN" || fltSts_code == "DVT" || fltSts_code == "DWN") {
            //到达,返航 备降 落地 修改实际起飞和实际到达时间
            showDepDt = info.actDepDt; //实际起飞
            showArvDt = info.actArvDt; //实际到达
            if (fltSts_code == "DWN") {
                //落地
                showArvDt = info.schArvDt; //预计到达
            }
        }

        if (fltSts_code == "DVT" || fltSts_code == "DVTO") {
            //备降、已备降 航段
            showDepDt = info.actDepDt;
            if (fltSts_code == "DVT") {
                showArvDt = info.schArvDt;
            } else {
                showArvDt = info.actArvDt;
            }
        }
        if (fltSts_code == "DLY" || fltSts_code == "CLSDR" || fltSts_code == "OFF" || fltSts_code == "BDSTR" || fltSts_code == "BDQCK") {
            //延误，提前，修改为预计起飞、预计到达、催促登机
            showDepDt = info.schDepDt;
            showArvDt = info.schArvDt;
        }
        showDepDt = showDepDt || info.crewDepDt;
        showArvDt = showArvDt || info.crewArvDt; //默认是预计时间
        return {
            showDepDt: showDepDt,
            showArvDt: showArvDt
        };
    },

